import React from 'react';

import classes from './CarServices.module.css';

const CarServices = (props) => {

const carServices = props.allCarServices.map((service, pos) => {
  return <div key={pos} className={classes['car-services-list']}><ul >
    <li>service: <p>{service.service}</p></li>
    <li>date: <p>{service.date}</p></li>
    <li>mileage: <p>{service.mileage}</p></li>
    <li>info: <p>{service.info}</p></li>
  </ul></div>;
})

console.log(carServices);

  return (
    <div className={classes['car-services']}>
      {carServices}
    </div>
  );
};

export default CarServices;
